import React from "react";
import { Router, NavLink, Switch, Route } from "react-router-dom";
import { createBrowserHistory } from "history";
import "./Navigation.css";

function Navigation() {
  const newHistory = createBrowserHistory();
  return (
    <div className='Nav'>
      <Router history={newHistory}>
        <NavLink className='NavLink' to="/"><i class="fa fa-credit-card" aria-hidden="true"> </i> Expenditure</NavLink>
        <NavLink className='NavLink' to="/transactions">Transactions</NavLink>
        <Switch>
          <Route path="/"></Route>
          <Route path="/"></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default Navigation;
